//fonts.google.com/specimen/Barlow+Semi+Condensed?preview.text_type=custom" target="_blank">Semi Condensed</a> and <a href="https://fonts.google.com/specimen/Barlow+Condensed?preview.text_type=custom" target="_blank">Condenseda</a>, each with 9 weights in Roman and Italic. <br> The Barlow project is led by Jeremy Tribby, a designer based in San Francisco, USA. To contribute, see <a href="https://github.com/jpt/barlow" target="_blank">github.com/jpt/barlow</a></p></div><div class="block--heading" id="Roboto"><h2 class="h h--h2"><a href="#Roboto" class="h__anchor">Roboto</a><span class="h__anchor__indicator">#</span></h2></div><div class="block block--text"><p> Roboto has a dual nature. It has a mechanical skeleton and the forms are largely geometric. At the same time, the font features friendly and open curves. While some grotesks distort their letterforms to force a rigid rhythm, Roboto doesn’t compromise, allowing letters to be settled into their natural width. This makes for a more natural reading rhythm more commonly found in humanist and serif types. <br> This is the regular family, which can be used alongside the <a href="https://fonts.google.com/specimen/Roboto+Condensed" target="_blank">Roboto Condensed</a> family and the <a href="https://fonts.google.com/specimen/Roboto+Slab" target="_blank">Roboto Slab</a> family. <br> To contribute, see <a href="https://github.com/google/roboto/" target="_blank">github.com/google/roboto</a></p></div>',6);co.render=function(e,t,o,l,s,n){return r(),a("article",io,[po])};const ho=[{path:"/brand",name:"brand",redirect:{name:"brand-overview"},components:{default:K},children:[{path:"overview",name:"brand-overview",component:re},{path:"colorpalette",name:"brand-colorpalette",component:de},{path:"typography",name:"brand-typography",component:co}]}];var uo=e({name:"SystemView",components:{AppLogo:N},setup(){const e=n(""),t=v();return d((()=>t.name),(t=>{"string"==typeof t&&(e.value=t)})),c((()=>{"string"==typeof t.name&&(e.value=t.